The median to the hypotenuse of a right triangle has length half the hypotenuse, so $BM = AM$, which means $\angle ABM = \angle BAM$.  Therefore, we have $\cos \angle ABM = \cos \angle BAM = \cos\angle BAC = \frac{AB}{AC} = \frac{10}{26} = \boxed{\frac{5}{13}}$.

We begin with a system of two equations \begin{align*}
2d&=17e-8
\\2e&=d-9
\end{align*}Since the second equation can also be rewritten as $d=2e+9$, we can plug this expression for $d$ back into the first equation and solve for $e$ \begin{align*}
2d&=17e-8
\\\Rightarrow \qquad 2(2e+9)&=17e-8
\\\Rightarrow \qquad 4e+18&=17e-8
\\\Rightarrow \qquad -13e&=-26
\\\Rightarrow \qquad e&=\boxed{2}.
\end{align*}

We can use Pascal's identity $ \binom{n-1}{k-1}+\binom{n-1}{k}=\binom{n}{k}$ to find $\binom{15}{9}$.

\begin{align*}
\binom{15}{8}+\binom{15}{9}&=\binom{16}{9} \rightarrow \\
6435+\binom{15}{9}&=11440 \rightarrow \\
\binom{15}{9}&=5005
\end{align*}

We can use the identity again to find $\binom{15}{10}$.

\begin{align*}
\binom{15}{9}+\binom{15}{10}&=\binom{16}{10} \rightarrow \\
5005+\binom{15}{10}&=8008 \rightarrow \\
\binom{15}{10}&=3003
\end{align*}

Therefore, $\binom{15}{10}=\boxed{3003}$.

Dividing by $400,$ we get the standard form of the equation for the first ellipse: \[\frac{x^2}{16}+\frac{y^2}{25}=1.\]Therefore, the semiaxes have lengths $\sqrt{16}=4$ and $\sqrt{25}=5,$ which means that the distance from the center $O=(0,0)$ to each focus is $\sqrt{5^2-4^2}=3.$ Since the vertical axis is longer than the horizontal axis, it follows that the foci of the first ellipse are at $(0, \pm 3).$

[asy]
